import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import PostThread from './post_thread.component';
import axios from 'axios';
import ThreadThumbnail from './thread_thumbnail.component';

export default class Catalog extends Component{
    constructor(props){
        super(props);

        this.componentDidMount = this.componentDidMount.bind(this);

        this.state = {
            threads: []
        };
    }

    componentDidMount(){
        axios.get("http://localhost:5000/thread")
        .then(res =>{
            console.log(res.data);
            this.setState({threads: res.data});
        });
        console.log("STATE: " + this.state.threads);
    }

    render(){
        return(
            <div>
                <PostThread props={this.state.threads} />
                Catalog
                Numthreads: {this.state.threads.length}
                <ul>
                    {
                        this.state.threads.map((thread) => (
                            <li key={thread.id}>
                                <ThreadThumbnail/>
                            </li>
                        ))
                    }
                </ul>
                Le end
            </div>
        );
    }
}
